import React from "react";

import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
//import { Link } from 'react-router-dom';

const Footer = () => {
  return (
    <div>
                        <Navbar bg="primary" variant="dark" className="navbar navbar-expand-md navbar-dark bg-dark">
        <Container>

          <Nav className="footer">
          <div className="navbar-collapse collapse w-100 order-1 order-md-0 dual-collapse2">
            <Navbar.Brand className="footer">Star Wars shop graduate work and test issue from Oleg Martynov</Navbar.Brand>

            <Nav.Link href="https://github.com/hristinson/graduate_React">Github/hristinson</Nav.Link>
            </div>

          </Nav>
        </Container>
      </Navbar>

    </div>
  );
}

export default Footer;
